-- Table structure for rule_number
-- ----------------------------
DROP TABLE IF EXISTS `rule_number`;
CREATE TABLE `rule_number` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `rank` int(11) DEFAULT NULL COMMENT '名词，其中1~10为对应的名词，11位冠亚和',
  `number` int(11) DEFAULT NULL COMMENT '名次对应的车道，1~10的名此对应为车道，名此为11对应的为冠亚和的值',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `update_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `rate` decimal(10,2) DEFAULT '1.00' COMMENT '赔率，存储整数，显示时除以100',
  `remark` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `uni_rule_number_rank_number` (`rank`,`number`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=20 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of rule_number
-- ----------------------------

