-- Table structure for rule_side
-- ----------------------------
DROP TABLE IF EXISTS `rule_side`;
CREATE TABLE `rule_side` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `side` tinyint(2) DEFAULT '0' COMMENT '1-单，2-双，3-大，4-小，5-龙，6-虎',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `update_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `rate` decimal(10,2) DEFAULT '1.00',
  `rank` int(11) DEFAULT NULL COMMENT '名次，对应rule_number中的rank',
  `remark` varchar(255) DEFAULT NULL,
  `side_name` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `uni_rule_side_rank_side_side_name` (`side`,`rank`,`side_name`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8;

